import React from "react";
import AdminNavbar from "./DashboardComponents/AdminDashNav";
import AdminSidebar from "./DashboardComponents/Adminsidebar";
import "./index.css";

const AdminDashboard = () => {
  return (
    <>
      <div className="contaniner-fluid">
        <div className="row">
          <AdminSidebar />
          <div className="col-md-9 dashboardmainarea">
            <AdminNavbar />
            <div className="dashboard_main_area row">
              <AdminDashboardCards/>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default AdminDashboard;
